            };
            foreach (Role role in roles)
            {
                _applicationContext.Roles.Add(role);
            }
        }

        public void LoadUsers()
        {
            var passwordHasher = new PasswordHasher();

            var users = new User[]
            {
        new User
        {
            Name = "Alicia", LastName = "Fernández", Email = "alice@example.com",
            Password = passwordHasher.HashPassword("Password-01"), RoleId = 1
        },
        new User
        {
            Name = "Ricardo", LastName = "Rodríguez", Email = "ricardo@example.com",
            Password = passwordHasher.HashPassword("Password-02"), RoleId = 2
        },
        new User
        {
            Name = "Mario", LastName = "Martínez", Email = "mario@example.com",
            Password = passwordHasher.HashPassword("Password-03"), RoleId = 1
        },
        new User
        {
            Name = "Carlos", LastName = "Ramírez", Email = "carlos@example.com",
            Password = passwordHasher.HashPassword("Password-04"), RoleId = 2
        }
            };

            foreach (User user in users)
            {
                _applicationContext.Users.Add(user);
            }

            _applicationContext.Users.AddRange(users);
            _applicationContext.SaveChanges();

            Random random = new Random();

            var songs = _applicationContext.Songs.Select(s => s.Id).ToList();

            foreach (User user in users)
            {

                int numberOfPlays = random.Next(10, 40);
                var idSongs = songs.OrderBy(x => Guid.NewGuid()).Take(numberOfPlays).ToList();

                foreach (var songId in idSongs)
                {
                    int totalStreams = new Random().Next(1, 100);

                    var history = new History
                    {
                        UserId = user.Id,
                        SongId = songId,
                        PlayedAt = DateTime.UtcNow.AddDays(-new Random().Next(1, 30)),
                        MyPlayCount = totalStreams
                    };

                    _applicationContext.Histories.Add(history);
                }
            }

            _applicationContext.SaveChanges();

            Console.WriteLine("Users and histories loaded:");
        }

